import React from 'react';
import { NavLink } from 'react-router-dom';
import Slider from 'react-slick';
import s from './VisualManagerInst.module.css';
import mini from '../../images/price/featureVideo/discountPrice/mini.png';
import middle from '../../images/price/featureVideo/discountPrice/medium.png';
import max from '../../images/price/featureVideo/discountPrice/maxi.png';
import arrow from '../../images/price/arrow.png';


let tarif = ['⠀МИНИ','МЕДИУМ','МАКСИ'];
const VisualManagerInst =()=>{
    let settings = {
        dots:true,
        infinite:false,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'35px',
        dotsClass: s.dots,
        customPaging: i => (
            <div >
                <span>{tarif[i]}</span>
            </div>
          )
    };
    return(
<div>
VisualManagerInst
</div>
    );
};

export default VisualManagerInst;
